import React from "react";
import "./footer.styles.css";


function Footer(){
    return(

        <div className="footer">
            <img src='https://www.google.com/search?q=twitter+logo+for+footer&sxsrf=APq-WBuAa3t1WO_-owdpqVYduW0IpgpMxw:1648582441668&tbm=isch&source=iu&ictx=1&vet=1&fir=y6QSA4rr-HmqNM%252CV08XhMkFvlA2nM%252C_%253BHCvdq5i2iGnQXM%252CV08XhMkFvlA2nM%252C_%253ByICqcnvbc1VrfM%252Cu5TaglSRjva6cM%252C_%253B57SgnRBI-vSslM%252CDSCmP-zE3n6YpM%252C_%253BF6f6UMMdQ7JsWM%252Cl6CiDatFIuu9AM%252C_%253ByyR-Br8DeH9zXM%252CAXHojoCr9Lic7M%252C_%253BCCOEeNQLY-U6tM%252CV_XxZl-Xun9CeM%252C_%253B74D7sQHd3KjIRM%252CcI7Ba4fkoSWWJM%252C_%253Bm1oGGCKSzEBykM%252ClmocgQiekuYRkM%252C_%253BAqTqDUzKMy2WTM%252C0iO3dWik99j7KM%252C_%253BwCoi6LvnJbB9lM%252C_VzPRNm4IljI-M%252C_%253BFbe24Qp6YhbKOM%252CqDF1Ro_4rcL-TM%252C_%253B_T4j9Rw_smdxkM%252CCejiBolEujTZnM%252C_%253BPDSuaX67zwAi5M%252CbuRuuuHk9bkVAM%252C_%253B0jGyX-3zp_krZM%252Cuj1wGP4f6aXcnM%252C_&usg=AI4_-kTyDTPpeNhwJr1q-X5EtAxWTqauYQ&sa=X&ved=2ahUKEwju9cWWiOz2AhWJD-wKHXiWA4UQ9QF6BAgGEAE#imgrc=y6QSA4rr-HmqNM' alt="h" />
            <img src="../media/facebook.png" alt="g" />
            <img src="../media/linkedin.png" alt="f" />
            <img src="../media/instagram.png" alt="d" />
            <img src="../media/github.png" alt="s" />
        </div>



    )
}


export default Footer;
